uint8_t UserIndex = 0; // index of the cards of the player
uint8_t OpponentIndex = 0; // index of the cards of the opponent 
uint8_t GameOver = 0; // 0 if still playing, 1 if over
uint8_t TableStatus[3]; // 0 if there is a card not there, 1 if there is, This is used for the cursor
uint8_t CursorChanged = 0; // if the cursor chagned, this becomes a 1, know when to play sound
uint8_t CurrentCursor = 0; //0,1,2 for left, middle, right.
uint8_t SelectButton = 0; // 0 means it is not pressed, 1 means it has been pressed, make sure to clear this
uint8_t FlipButton = 0;
uint32_t RandomNum = 0;
uint8_t Tie = 0; 
uint8_t PlayerWins = 0;
uint8_t OpponentWins = 0; // 0 if lost hand, 1 if won
uint8_t NoOneWins = 0;
uint8_t LeftIndex, RightIndex, MiddleIndex;
uint8_t MoveDownFlag = 0;
uint8_t MoveMiddleFlag = 0;
uint8_t FlippedFlag = 0;
uint8_t CheckWinnerFlag = 0;
uint8_t EndTurn = 0; 
uint8_t SoundPlayed = 0;
uint8_t SpawnedCardFlag = 0;
uint8_t ScoreChanged = 0;
