uint8_t SCMoveDown = 0;
uint8_t SCMoveRight = 0;
uint8_t SCMoveLeft = 0;
uint8_t OCMoveRight = 0;
uint8_t OCMoveLeft = 0;

uint8_t LastFlagOMG = 0;

uint8_t SelectSound = 0;

uint8_t MultiplayerMode = 0;

