// Put all of these pointer to images in an array that will be used in Initilization
const uint16_t* images[] = {Two,Three,Four,Five,Six,Seven,Eight,Nine,Ten,Jack,Queen,King,Ace};

// Create the structures for the cards and players and the cursor
struct Struct { // for the card
		int32_t x;
		int32_t y;
		const uint16_t *image;
		uint8_t value;
		uint8_t show;
	};

typedef struct Struct Card;
Card Deck[52]; // the deck of 52 cards
Card SelectedCard;

	struct Struct2 { // for each player
		uint32_t score;
		struct Struct Cards[26];
	};

typedef struct Struct2 Players;
Players Player[2]; // 2 players

struct Struct3 { // for the cursor
		int32_t xpos;
		int32_t ypos;
		uint8_t show;
	};
typedef struct Struct3 Cursors;
Cursors Cursor;

//-------------Deck_Init-------------
//Init and shuffles the structure of cards called deck, which has 52 elements
void Deck_Init(void){		
		for(int i=0; i<52; i++){
			Deck[i].y = 144; // figure out what the y value is at the bottom of the screen
//			Deck[i].image = Back;
			Deck[i].image = images[i/4];
			Deck[i].value = (i/4) + 2; 
			Deck[i].show = 0;
		}
		// shuffling the deck
		for(int j=0; j<52; j++){
			uint16_t Ran = Random()%52; // a number from 0 to 51
			Card temp = Deck[j];
			Deck[j] = Deck[Ran];
			Deck[Ran] = temp; // swapping the card at the current index with the card at the random index
		}
}

//-------------Player_Init-------------
//Each player starts with a score of 0 and each gets half of the shuffled deck
void Player_Init(void){
	uint32_t j = 26;
	Player[0].score = 0; Player[1].score = 0;
	for(int i=0;i<26;i++){
		Player[0].Cards[i] = Deck[i];
		Player[1].Cards[i] = Deck[j];
		j++;
	}
	Player[0].Cards[0].x = 10;
	Player[0].Cards[1].x = 49;
	Player[0].Cards[2].x = 88;
	Player[0].Cards[0].show = 1;
	Player[0].Cards[1].show = 1;
	Player[0].Cards[2].show = 1;
	TableStatus[0] = 1;
	TableStatus[1] = 1;
	TableStatus[2] = 1;
	LeftIndex = 0;
	MiddleIndex = 1;
	RightIndex = 2; 
	UserIndex = 3; // check to see where this is needed
	SelectedCard.show = 0;
	SpawnedCardFlag = 1;
}

//-------------Cursor_Init-------------
//The cursor has a x position that changed and y position that is always the same
void Cursor_Init(void){
	Cursor.ypos = 159; // always will be the same
	Cursor.xpos = 19; // Start it in on the left because CurrentCursor is 0
	Cursor.show = 1;
}

//-------------PortE_Init-------------
//Inits Port E 0 and 1 that are the two buttons
void PortE_Init(void){
		volatile uint32_t delay;
		SYSCTL_RCGCGPIO_R |= 0x10; // port E
		delay = SYSCTL_RCGCGPIO_R;
		GPIO_PORTE_DIR_R &= ~0x03; //PE 0-1,3 are inputs, set to 0
		GPIO_PORTE_AFSEL_R &= ~0x03;
		GPIO_PORTE_AMSEL_R &= ~0x03;
		GPIO_PORTE_DEN_R |= 0x03;
}

//-------------Edge_Init-------------
//Inits Port E 0 and 1 as Edge Interrupts
void Edge_Init(void){
		GPIO_PORTE_PCTL_R &= ~0x000000FF; //  configure PE0,1 as GPIO
		GPIO_PORTE_IS_R &= ~0x03;     //  PE0,1 are edge-sensitive
		GPIO_PORTE_IBE_R &= ~0x03;    //   PE0,1 are not both edges
		GPIO_PORTE_IEV_R |= 0x03;    //    PE0,1 rising edge event
		GPIO_PORTE_ICR_R = 0x03;      // clear flags 0-1
		GPIO_PORTE_IM_R |= 0x03;      //  arm interrupt on PE0,1
		NVIC_PRI1_R = (NVIC_PRI1_R&0xFFFFFF00)|0x00000040; //priority 1
		NVIC_EN0_R = 0x00000010;      // enable interrupt 4 in NVIC
	//NVIC_DIS0_R = 0x00000010;    // disable interrupt 4 in NVIC
}

