//-------------Convert-------------
//Convert the ADC sample into a 0, 1 or 2 (left, middle, right)
//ADC range is from 0 to 4095
uint32_t Convert(uint32_t Input){
	if (Input < 1365) {
		return 0;
	}
	else if (Input > 2730) {
		return 2; 
	}
	else {
		return 1;
	}
}

//-------------Check_Cursor-------------
//This function will check if the slide pot has been moved to change the x position of the cursor
//CurrentCursor is the current state of the cursor. 0 means it is on the left, 1 means middle, 2 means right.
//SlideInput will be converted into a 0, 1, or 2
//Set CurrentCursor to 1 if the cursor position has changed
void Check_Cursor(void){
	uint32_t SlideInput = ADC_In(); // samples the slide pot, 0 to 4095
	SlideInput = Convert(SlideInput);
	if (SlideInput != CurrentCursor){
		CursorChanged = 1; // used to know if we should output the sound
		CurrentCursor = SlideInput;
		if (CurrentCursor == 0) {
			Cursor.xpos = 19; 
	} else if (CurrentCursor == 1) {
			Cursor.xpos = 58; 
	} else {
			Cursor.xpos = 97;
		}
	} 
	else {
		CursorChanged = 0;
	}	
}

//-------------Select_Card-------------
// When the button is pressed, a card is selected. Make sure it is a valid selection. 
void Select_Card(void){
  if (SelectButton == 1 && SpawnedCardFlag == 1) { // need another flag to check if current hand is done
		if (TableStatus[CurrentCursor] == 1) {
			if (CurrentCursor == 0) {
				SelectedCard = Player[0].Cards[LeftIndex];
				Player[0].Cards[LeftIndex].show = 0;
				TableStatus[0] = 0;
			}
			else if (CurrentCursor == 1) {
				SelectedCard = Player[0].Cards[MiddleIndex];
				Player[0].Cards[MiddleIndex].show = 0;
				TableStatus[1] = 0;
			}
			else if (CurrentCursor == 2) {
				SelectedCard = Player[0].Cards[RightIndex];
				Player[0].Cards[RightIndex].show = 0;
				TableStatus[2] = 0;

			}
			SelectSound = 1;
			MoveDownFlag = 1;
			SelectButton = 0;
			SpawnedCardFlag = 0;
			Cursor.show = 0;
			SelectedCard.show = 1;
		}
		else{
			SelectButton = 0; //If not a valid move, they have to press the button again 
		}
	} 
	else {
		SelectSound = 0;
	}
}

//-------------Move_Down-------------
// Move the selcted card down until it moves off screen. Then, set coordinates for middle. 
void Move_Down(void){
	if (MoveDownFlag == 1){
		if (SelectedCard.y != 199) { // was 199
			SelectedCard.y++;
			SCMoveDown = 1;
		} 
		else {
		if (MultiplayerMode == 1) {
			UART_OutChar(SelectedCard.value);	
			uint8_t OtherValue = UART_InChar();
			Player[1].Cards[OpponentIndex].value = OtherValue; 
		}
			MoveDownFlag = 0; 
			SelectedCard.x = -27;
			SelectedCard.y = 85;
			Player[1].Cards[OpponentIndex].x = 127;
			Player[1].Cards[OpponentIndex].y = 85;
			Player[1].Cards[OpponentIndex].show = 1;
			MoveMiddleFlag = 1; 
			SCMoveDown = 0;
			Player[1].Cards[OpponentIndex].image = Back; 
			SelectedCard.image = Back;
		
		}
	}
}

//-------------Move_Middle-------------
// Move the two cards to middle. 
void Move_Middle(void){
  if (MoveMiddleFlag == 1) {
		if (SelectedCard.x != 28){
			SelectedCard.x++;
			Player[1].Cards[OpponentIndex].x--;
			SCMoveRight = 1;
			OCMoveLeft = 1;
		}	
		else {
			SCMoveRight = 0;
			OCMoveLeft = 0;
			MoveMiddleFlag = 0;
			LastFlagOMG = 1; 
		}
	}
}

//-------------Flip_Cards-------------
// Need to test if they are in the middle. if the pos is the middle
void Flip_Cards(void){
	if (FlipButton == 1 && LastFlagOMG == 1){
		SelectedCard.image = images[SelectedCard.value-2];
		Player[1].Cards[OpponentIndex].image = images[Player[1].Cards[OpponentIndex].value-2];
		FlipButton = 0;
		FlippedFlag = 1;
		LastFlagOMG = 0;
	}
	else {
		FlipButton = 0; 
	}
}

//-------------Check_Winner-------------
//Determine who wins the hand
//PlayerWins and OpponentWins are set. 1 means they won the hand. Where do we clear this?
void Check_Winner(void){
	if (FlippedFlag  == 1) {
		if (SelectedCard.value > Player[1].Cards[OpponentIndex].value) {
			Player[0].score = Player[0].score + 1 + Tie;
			ScoreChanged = 1;
			Tie = 0;
			PlayerWins = 1;
		}
		if (SelectedCard.value < Player[1].Cards[OpponentIndex].value) {
			Player[1].score = Player[1].score + 1 + Tie;
			Tie = 0;
			ScoreChanged2 = 1;
			OpponentWins = 1;
		}
		if (SelectedCard.value == Player[1].Cards[OpponentIndex].value) {
			Tie++;
			NoOneWins = 1;	
		}
	FlippedFlag = 0;
	CheckWinnerFlag = 1;
	}
	// print to the screen "You win" or "You lose" based on PlayerWins and OpponentWins
}

//-------------Move_OffScreen-------------
// Move the two cards  
void Move_OffScreen (void){
  if (CheckWinnerFlag == 1) {

		if (PlayerWins == 1 && Player[1].Cards[OpponentIndex].x > 42){
			Player[1].Cards[OpponentIndex].x--;
			OCMoveLeft = 1;
		}
		else if (PlayerWins == 1 && Player[1].Cards[OpponentIndex].x != -27){
			Player[1].Cards[OpponentIndex].x--;
			SelectedCard.x--;
//			SCMoveLeft = 1; //maybe don't need this
			OCMoveLeft = 1;
		}
		else if (PlayerWins == 1) {
			PlayerWins = 0;
			SelectedCard.show = 0;
			Player[1].Cards[OpponentIndex].show = 0;
			CheckWinnerFlag = 0;
			EndTurn = 1;
			SCMoveLeft = 0;
			OCMoveLeft = 0;
		}
		if (OpponentWins == 1 && SelectedCard.x < 57) {
			SelectedCard.x++;
			SCMoveRight = 1;
		}
		else if (OpponentWins == 1 && SelectedCard.x != 127){
			Player[1].Cards[OpponentIndex].x++;
			SelectedCard.x++;
			SCMoveRight = 1;
//			OCMoveRight = 1; //maybe don't need this
		}
		else if (OpponentWins == 1) {
			OpponentWins = 0;
			SelectedCard.show = 0;
			Player[1].Cards[OpponentIndex].show = 0;
			CheckWinnerFlag = 0;
			EndTurn = 1;
			SCMoveRight = 0;
			OCMoveRight = 0;
		}
		if (NoOneWins == 1 && SelectedCard.x != -27) {
			SelectedCard.x--;
			Player[1].Cards[OpponentIndex].x++;
			SCMoveLeft = 1;
			OCMoveRight = 1;
		} 
		else if (NoOneWins == 1) {
			NoOneWins = 0;
			SelectedCard.show = 0;
			Player[1].Cards[OpponentIndex].show = 0;
			CheckWinnerFlag = 0;
			EndTurn = 1;
			SCMoveLeft = 0;
			OCMoveRight = 0;
		}
	}
}

//-------------Spawn_Card------------
// Spawns a new card where the last one was taken
void Spawn_Card (void){	
	if (EndTurn == 1){
		if (TableStatus[0] == 0 && UserIndex != 26) {
			TableStatus[0] = 1; 
			LeftIndex = UserIndex;
			UserIndex++;
			Player[0].Cards[LeftIndex].x = 10;
			Player[0].Cards[LeftIndex].show = 1;
		}
		if (TableStatus[1] == 0 && UserIndex != 26) {
			TableStatus[1] = 1; 
			MiddleIndex = UserIndex;
			UserIndex++;
			Player[0].Cards[MiddleIndex].x = 49;
			Player[0].Cards[MiddleIndex].show = 1;
		}
		if (TableStatus[2] == 0 && UserIndex != 26) {
			TableStatus[2] = 1; 
			RightIndex = UserIndex;
			UserIndex++;
			Player[0].Cards[RightIndex].x = 88;
			Player[0].Cards[RightIndex].show = 1;
		}
		Cursor.show = 1;
		OpponentIndex++;
		SpawnedCardFlag = 1;
		if (TableStatus[0] != 0 || TableStatus[1] != 0 || TableStatus[2] != 0) {
			EndTurn = 0; }
		SelectButton = 0;
	}
}

//-------------Check_GameOver-------------
//If there are no more cards in the deck, Game Over.
void Check_GameOver (void){
  if (UserIndex == 26 && TableStatus[0] == 0 && TableStatus[1] == 0 && TableStatus[2] == 0 && EndTurn == 1) {
		GameOver = 1;
	}
}

//-------------GPIOPortE_Handler-------------
//PE 0 is select, PE 1 is flip
void GPIOPortE_Handler(void){
	if (GPIO_PORTE_RIS_R == 0x01){
		GPIO_PORTE_ICR_R = 0x01;
		SelectButton = 1;
	}
	if (GPIO_PORTE_RIS_R == 0x02){
		GPIO_PORTE_ICR_R = 0x02;
		FlipButton = 1;
	}
}

//-------------Update_Board-------------
// Main game engine that runs with Timer0
//
void Update_Board(void){
	
	if (GameOver == 1) {
		uint16_t Green_Background = ST7735_Color565(10,156,44);
		ST7735_FillScreen(Green_Background);  // set screen to green
		ST7735_SetCursor(0,0);
		ST7735_OutString("Game Over!");
		ST7735_SetCursor(0,2);
		ST7735_OutString("Your hands won:");
		ST7735_SetCursor(0,4);
		LCD_OutDec(Player[0].score);
		ST7735_SetCursor(0,6);
		ST7735_OutString("Opponent's hands won:");
		ST7735_SetCursor(0,8);
		LCD_OutDec(Player[1].score);
		ST7735_SetCursor(0,10);
		if (Player[0].score > Player[1].score){
			ST7735_OutString("You win!");
			if (SoundPlayed == 0){
				Sound_Win();
				SoundPlayed = 1;
			}
		} else  if (Player[0].score == Player[1].score){
			ST7735_OutString("You tie.");
		} else {
			ST7735_OutString("You lose..");
			if (SoundPlayed == 0){
				Sound_Lose();
				SoundPlayed = 1;
			}
		}
		TIMER0_CTL_R = 0x0000000;    //disable TIMER0A 
	}	
	else {

		uint16_t Green_Background = ST7735_Color565(10,156,44);
		
		ST7735_SetTextColor(0); // right now, text is black
		ST7735_SetCursor(4,3);
		ST7735_OutString("You: ");
		ST7735_SetCursor(12,3);
		ST7735_OutString("Them: ");
		
		if (ScoreChanged == 1) {
			ST7735_FillRect(8, 3, 5, 5, Green_Background);
			ST7735_SetCursor(8,3);
			LCD_OutDec(Player[0].score);
			ScoreChanged = 0;
		}
		else if (ScoreChanged == 0) {
			ST7735_SetCursor(8,3);
			LCD_OutDec(Player[0].score);
		}
		
		if (ScoreChanged2 == 1) {
			ST7735_FillRect(17, 3, 5, 5, Green_Background);
			ST7735_SetCursor(17,3);
			LCD_OutDec(Player[1].score);
			ScoreChanged = 0;
		}
		else if (ScoreChanged2 == 0) {
			ST7735_SetCursor(17,3);
			LCD_OutDec(Player[1].score);
		}
		
		
		Check_Cursor();
		if (Cursor.show) {
			if (CursorChanged == 1) {
				ST7735_FillRect(0, 144, 127, 15, Green_Background);
				ST7735_DrawBitmap(Cursor.xpos, Cursor.ypos, cursor, 10, 15); 
				Sound_Click();
			}
			else {
				ST7735_DrawBitmap(Cursor.xpos, Cursor.ypos, cursor, 10, 15); 
			}
		}
	
		if (Player[0].Cards[LeftIndex].show) {
			ST7735_DrawBitmap(Player[0].Cards[LeftIndex].x, Player[0].Cards[LeftIndex].y, Player[0].Cards[LeftIndex].image, 28, 40); 
		}
		if (Player[0].Cards[MiddleIndex].show) {
			ST7735_DrawBitmap(Player[0].Cards[MiddleIndex].x, Player[0].Cards[MiddleIndex].y, Player[0].Cards[MiddleIndex].image, 28, 40); 
		}
		if (Player[0].Cards[RightIndex].show) {
			ST7735_DrawBitmap(Player[0].Cards[RightIndex].x, Player[0].Cards[RightIndex].y, Player[0].Cards[RightIndex].image, 28, 40); 	
		}
		
		if (SelectedCard.show) {
			 if (SCMoveDown == 1) { 
			 	ST7735_FillRect(SelectedCard.x, (SelectedCard.y-40)-1, 28, 1, Green_Background);
				ST7735_DrawBitmap(SelectedCard.x, SelectedCard.y, SelectedCard.image, 28, 40); 
			 }
			 else if (SCMoveRight == 1 && SelectedCard.x > 0 ) { // this line was messing up simulator
				ST7735_FillRect(SelectedCard.x-1, (SelectedCard.y-40), 1, 42, Green_Background);
				ST7735_DrawBitmap(SelectedCard.x, SelectedCard.y, SelectedCard.image, 28, 40);
			 }
			 else if (SCMoveLeft == 1) {
				ST7735_FillRect((SelectedCard.x+28)+1, (SelectedCard.y-40), 1, 42, Green_Background);
				ST7735_DrawBitmap(SelectedCard.x, SelectedCard.y, SelectedCard.image, 28, 40);
			 }
			 else {
				 ST7735_DrawBitmap(SelectedCard.x, SelectedCard.y, SelectedCard.image, 28, 40);
			 }
		}
		
		
		if (Player[1].Cards[OpponentIndex].show){
			if (OCMoveRight == 1) {
				ST7735_FillRect(Player[1].Cards[OpponentIndex].x-1, Player[1].Cards[OpponentIndex].y-40, 1, 42, Green_Background);
				ST7735_DrawBitmap(Player[1].Cards[OpponentIndex].x, Player[1].Cards[OpponentIndex].y, Player[1].Cards[OpponentIndex].image, 28, 40);
			 }
			else if (OCMoveLeft == 1) {
				ST7735_FillRect((Player[1].Cards[OpponentIndex].x+28)+1, Player[1].Cards[OpponentIndex].y-40, 1, 42, Green_Background);
				ST7735_DrawBitmap(Player[1].Cards[OpponentIndex].x, Player[1].Cards[OpponentIndex].y, Player[1].Cards[OpponentIndex].image, 28, 40);
			 }
			else {
			ST7735_DrawBitmap(Player[1].Cards[OpponentIndex].x, Player[1].Cards[OpponentIndex].y, Player[1].Cards[OpponentIndex].image, 28, 40);
			}
		}
		
		Select_Card();
		if (SelectSound == 1){
			Sound_Beep();
			
		}
		Move_Down();
		Move_Middle();
		
		Flip_Cards();
		if (FlippedFlag == 1){
			Sound_CardFlip();
		}
		Check_Winner();
		Move_OffScreen();
		Spawn_Card();
		Check_GameOver();
	}
		
}

